import { Row, Container, Col } from "react-bootstrap";

const ProjectCard = ({ URL, projects }) => {
  return (
    <>
      {projects.map((project) => {
        const {
          projectID,
          title,
          department,
          priority,
          client,
          price,
          startDate,
          endDate,
          team,
          status,
          description,
        } = project;

        return (
          <Container key={projectID}>
            <section className="project-card">
              <h2>Proj Name</h2>
              <Row>
                <p> {description} </p>
                <Col>
                  {" "}
                  <p>Created</p>
                  <p>Team Lead</p>
                  <p>Priority</p>
                  <p>Dealine</p>
                  <p>Comments</p>
                  <p>Bug</p>
                  <p>Team</p>
                </Col>
                <Col>
                  {" "}
                  <p> {startDate} </p>
                  <p>{team}</p>
                  <p> {priority} </p>
                  <p> {endDate} </p>
                  <p>{description}</p>
                            <p>Bug</p>
                            <p>${ department}</p>
                </Col>
              </Row>
            </section>
          </Container>
        );
      })}
      )
    </>
  );
};
export default ProjectCard;
